prediction.sparql:
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?person ?personLabel ?dateOfDeath ?archiveInstitution ?archiveInstitutionLabel WHERE {
  ?person wdt:P21 wd:Q6581072 .
  {
    ?person wdt:P19 wd:Q3240 .
  } UNION {
    ?person wdt:P570 ?dateOfDeath .
    FILTER ( ?dateOfDeath < "1948-01-01" ^^ xsd:dateTime ) .
    ?person wdt:P570 wd:Q3240 .
  }
  ?person rdfs:label ?personLabel .
  FILTER ( LANG( ?personLabel ) = 'en' ) OPTIONAL {
    ?person wdt:P570 ?dateOfDeath .
  }
  OPTIONAL {
    ?person wdt:P859 ?archiveInstitution .
    ?archiveInstitution rdfs:label ?archiveInstitutionLabel .
    FILTER ( LANG( ?archiveInstitutionLabel ) = 'en' )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?artist ?gender ?partner WHERE {
  VALUES ?artistType {
    wd:Q48202 wd:Q177220
  }
  .
  ?artist wdt:P31 ?artistType .
  ?artist wdt:P21 ?gender .
  ?artist ?partnerProperty ?partner .
  FILTER ( ?partnerProperty IN ( wdt:P735 , wdt:P736 ) )
}
LIMIT 10

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?version ?publicationDate WHERE {
  wd:Q83 p:P348 ?statement .
  ?statement ps:P348 ?version .
  OPTIONAL {
    ?statement pq:P577 ?publicationDate .
  }
}
ORDER BY ?publicationDate

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?lighthouse ?lighthouseLabel ?color ?colorLabel WHERE {
  ?lighthouse wdt:P31 wd:Q980720 .
  ?lighthouse wdt:P131 wd:Q504676 .
  OPTIONAL {
    ?lighthouse wdt:P462 ?color .
    ?color rdfs:label ?colorLabel .
    FILTER ( LANG( ?colorLabel ) = "en" )
  }
  OPTIONAL {
    ?lighthouse rdfs:label ?lighthouseLabel .
    FILTER ( LANG( ?lighthouseLabel ) = "en" )
  }
}

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?mascot ?mascotLabel ?image ?startTime ?endTimeFinal WHERE {
  wd:Q104770 wdt:P822 ?mascot .
  OPTIONAL {
    ?mascot rdfs:label ?mascotLabel .
    FILTER ( LANG( ?mascotLabel ) = 'en' )
  }
  OPTIONAL {
    ?mascot wdt:P18 ?image .
  }
  OPTIONAL {
    ?mascot p:P822 / psv:P822 / pq:P580 ?startTime .
  }
  OPTIONAL {
    ?mascot p:P822 / psv:P822 / pq:P582 ?endTime .
  }
  BIND( COALESCE ( ?endTime , NOW () ) AS ?endTimeFinal )
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?mountain ?mountainLabel WHERE {
  VALUES ?mountainLabel {
    'Mount Everest' @en 'K2' @en 'Kangchenjunga' @en 'Lhotse' @en 'Makalu' @en 'Cho Oyu' @en 'Dhaulagiri' @en 'Manaslu' @en 'Nanga Parbat' @en 'Annapurna' @en
  }
  ?mountain rdfs:label ?mountainLabel ; wdt:P31 wd:Q8502 ; wdt:P2044 ?elevation .
  FILTER ( ?elevation > 8000 ) OPTIONAL {
    ?mountain wdt:P625 ?location .
    ?location wdt:P31 wd:Q3302
  }
  FILTER ( ! BOUND( ?location ) )
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?event ?tournament WHERE {
  ?event wdt:P31 wd:Q187985 .
  ?event wdt:P710 ?tournament .
  FILTER NOT EXISTS {
    ?event wdt:P1346 ?winner
  }
  .
  ?tournament wdt:P31 wd:Q200102 .
  ?tournament wdt:P361 ?circuit .
  VALUES ?circuit {
    wd:Q300008 wd:Q3775082
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?person ?dateOfDeath ?familySearchID ?father WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P27 wd:Q138 ; wdt:P570 ?dateOfDeath ; wdt:P906 ?familySearchID ; wdt:P22 ?father .
  FILTER NOT EXISTS {
    ?father wdt:P906 ?fatherFamilySearchID
  }
}
LIMIT 10

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?book ?bookLabel WHERE {
  ?book wdt:P50 wd:Q35610 .
  OPTIONAL {
    ?book rdfs:label ?bookLabel FILTER ( LANG( ?bookLabel ) = 'en' )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?state ?stateLabel ?coordinates ?language ?languageLabel WHERE {
  {
    SELECT DISTINCT ?state ?stateLabel ?coordinates WHERE {
      ?state wdt:P31 wd:Q3624078 ; wdt:P625 ?coordinates .
      OPTIONAL {
        ?state rdfs:label ?stateLabel .
        FILTER ( LANG( ?stateLabel ) = 'en' )
      }
    }
    LIMIT 10
  }
  ?state wdt:P37 ?language .
  OPTIONAL {
    ?language rdfs:label ?languageLabel .
    FILTER ( LANG( ?languageLabel ) = 'en' )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?item ?yearOfCreation ?commemoratedEntity ?image ?coordinates WHERE {
  ?item wdt:P131 wd:Q607204 .
  OPTIONAL {
    ?item wdt:P571 ?yearOfCreation .
  }
  OPTIONAL {
    ?item wdt:P135 ?commemoratedEntity .
  }
  OPTIONAL {
    ?item wdt:P18 ?image .
  }
  OPTIONAL {
    ?item wdt:P625 ?coordinates .
  }
}
