PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?municipality ?municipalityLabel ?website ?coordinates ?state ?stateLabel WHERE {
  ?municipality wdt:P31 wd:Q15268 ; wdt:P131 wd:Q183 .
