    ?municipality wdt:P856 ?website .
  }
  OPTIONAL {
    ?municipality wdt:P625 ?coordinates .
  }
  OPTIONAL {
    ?municipality wdt:P131 ?state .
    ?state rdfs:label ?stateLabel
    FILTER ( LANG( ?stateLabel ) = 'en' ) .
  }
}
LIMIT 100

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?human WHERE {
  ?human wdt:P31 / wdt:P279 * wd:Q5 .
  ?human wdt:P19 / wdt:P131 * wd:Q408 .
  FILTER NOT EXISTS {
    ?human wdt:P21 []
  }
}
LIMIT 100

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?item ?creator ?placeOfBirth ?inventoryNumber ?image WHERE {
  ?item wdt:P195 wd:Q289215 .
  OPTIONAL {
    ?item wdt:P170 ?creator .
  }
  OPTIONAL {
    ?creator wdt:P19 ?placeOfBirth .
  }
  FILTER EXISTS {
    ?placeOfBirth wdt:P131 * wd:Q414
  }
  OPTIONAL {
    ?item wdt:P217 ?inventoryNumber .
  }
  OPTIONAL {
    ?item wdt:P18 ?image .
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?constituency ?constituencyLabel ?expectedSeats ?actualSeats WHERE {
  ?constituency wdt:P31 wd:Q27971968 ; wdt:P1410 ?actualSeats .
  OPTIONAL {
    ?constituency wdt:P1342 ?expectedSeats
  }
  FILTER ( ?actualSeats > 1 ) OPTIONAL {
    ?constituency rdfs:label ?constituencyLabel .
    FILTER ( LANG( ?constituencyLabel ) = 'en' )
  }
}

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?person ?position ?dateOfBirth ?placeOfBirth ?gender ?startTime ?endTime WHERE {
  ?person wdt:P39 ?position .
  ?position wdt:P17 wd:Q38 .
  ?position rdfs:label ?label .
  FILTER ( LANG( ?label ) = 'en' ) .
  FILTER ( CONTAINS( ?label , 'Minister' ) ) .
  OPTIONAL {
    ?person wdt:P569 ?dateOfBirth .
  }
  OPTIONAL {
    ?person wdt:P19 ?placeOfBirth .
  }
  OPTIONAL {
    ?person wdt:P21 ?gender .
  }
  OPTIONAL {
    ?position p:P39 ?statement .
    ?statement pq:P580 ?startTime .
    ?statement pq:P582 ?endTime .
  }
}
LIMIT 10

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?item WHERE {
  ?item wdt:P856 ?website .
  FILTER ( CONTAINS( ?website , 'https://twitter' ) || CONTAINS( ?website , 'http://twitter' ) )
}
LIMIT 100

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ?countryLabel ( MAX( ROUND( ?area ) ) AS ?roundedArea ) ( GROUP_CONCAT( DISTINCT ?partOfCountryLabel ; SEPARATOR = ', ' ) AS ?partOfCountryLabels ) WHERE {
  ?country wdt:P30 wd:Q46 ; rdfs:label ?countryLabel ; wdt:P2046 ?area .
  FILTER ( LANG( ?countryLabel ) = 'en' ) FILTER NOT EXISTS {
    ?country wdt:P576 ?dissolutionDate
  }
  {
    ?country wdt:P31 wd:Q3624078
  } UNION {
    ?country wdt:P31 wd:Q1170912
  }
  OPTIONAL {
    ?country wdt:P361 ?partOfCountry .
    ?partOfCountry rdfs:label ?partOfCountryLabel .
    FILTER ( LANG( ?partOfCountryLabel ) = 'en' )
  }
}
GROUP BY ?country ?countryLabel
ORDER BY DESC ( ?roundedArea )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
