PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?item ?itemLabel ( GROUP_CONCAT( DISTINCT ?instanceOfLabel ; separator = ', ' ) AS ?instanceOfLabels ) WHERE {
  ?item wdt:P830 ?eolId .
  FILTER NOT EXISTS {
    ?item wdt:P31 wd:Q16521
  }
  .
  FILTER NOT EXISTS {
    ?item wdt:P31 ?subclass .
    ?subclass wdt:P279 wd:Q16521
  }
  .
  OPTIONAL {
    ?item wdt:P31 ?instanceOf .
    ?instanceOf rdfs:label ?instanceOfLabel
    FILTER ( LANG( ?instanceOfLabel ) = 'en' )
  }
  .
  ?item rdfs:label ?itemLabel FILTER ( LANG( ?itemLabel ) = 'en' )
}
GROUP BY ?item ?itemLabel
LIMIT 100

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?award ?awardLabel ( COUNT( ?individual ) AS ?count ) WHERE {
  ?individual wdt:P166 ?award .
  VALUES ?awardType {
    wd:Q11448906 wd:Q15383322 wd:Q107471279 wd:Q378427 wd:Q107494520 wd:Q1966910 wd:Q1709894
  }
  ?award wdt:P31 ?awardType .
  OPTIONAL {
    ?award rdfs:label ?awardLabel .
    FILTER ( LANG( ?awardLabel ) = 'en' )
  }
}
GROUP BY ?award ?awardLabel
ORDER BY DESC ( ?count )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?occupation ?occupationLabel ?subclass ?subclassLabel WHERE {
  VALUES ?musicalProfession {
    wd:Q66715801
  }
  ?occupation wdt:P31 / wdt:P279 * ?musicalProfession .
  OPTIONAL {
    ?occupation rdfs:label ?occupationLabel .
    FILTER ( LANG( ?occupationLabel ) = 'en' )
  }
  OPTIONAL {
    ?subclass wdt:P279 ?occupation .
    ?subclass rdfs:label ?subclassLabel .
    FILTER ( LANG( ?subclassLabel ) = 'en' )
  }
}

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?municipality ?municipalityLabel ?recentPopulation ?recentYear ?pastPopulation ?pastYear WHERE {
